func _process(delta: float) -> void: var extents: Vector2 = ($CollisionShape2D.shape as RectangleShape2D).extents var ball_radius: float = (ball.get_node("CollisionShape2D").shape as CircleShape2D).radius var horizontal_distance: float = position.x - ball.position.x var vertical_distance: float = abs(position.y - extents.y - ball.position.y - ball_radius) var evaluation = neat.evaluate(id, ball.harmful, horizontal_distance, vertical_distance) var _collision: KinematicCollision2D = move_and_collide( evaluation * Vector2(1000, 0) * delta ) Each paddle is controlled every frame/step of the game framework by the respective neural network. The vertical and horizontal distance, along with the type of the ball, is fed into the neural network through its input layer. The output is simply a value ranging from -1 to 1 (inclusive) that is used to determine the horizontal velocity of the paddle. neat::evaluate belongs to the NEAT algorithm module, which plays the role of evaluating the input parameters using the neural network. This is how it's handled by the C++ library: double evaluate(int id, bool harmfulBall, float horizontalDistance, float verticalDistance)
{ try { vector<double> inputs, outputs(1, 0.0); inputs.push_back(harmfulBall); inputs.push_back(horizontalDistance); inputs.push_back(verticalDistance); neuralNetworks[id].evaluate(inputs, outputs); return outputs[0]; } catch (...) { Godot::print("Error occurred while trying to evaluate."); return 0; }
}

