Each paddle instance is going to have an ID representing it, allocated during the beginning of the evolution session. This is going to be used by the library for identifying the genome to retrieve its phenotype, evaluate it, and register its fitness value. The genomes and their associated neural networks (phenotypes) are stored in the library in ordered lists: shared_ptr<neat::pool> pool;
vector<neat::genome*> genomes;
vector<ann::neuralnet> neuralNetworks; This is how the list is populated: void update()
{ genomes.clear(); neuralNetworks.clear(); auto genomeSpeciePairs = pool->get_genomes(); for (auto pair : genomeSpeciePairs) { genomes.push_back(pair.second); ann::neuralnet neuralNetwork; neuralNetwork.from_genome(*pair.second); neuralNetworks.push_back(neuralNetwork); }
}
